  false,\n\t\"url\": null,\n\t\"notes\": \"The marsh and water management plan outlines
  and describes management strategies for maintenance, rehabilitation, and development
  of managed waters on the Clarence Cannon National Wildlife Refuge, and Delair and
  Gardner Divisions of the Mark Twain National Wildlife Refuge. This plan covers a
  five year period beginning in October, 1984. Management of waters on the three units
  is geared toward meeting primary objectives cited in the Master Plan for the Mark
  Twain National Wildlife Refuge: provide food, cover, and protection for migratory
  waterfowl, improve and maintain existing habitat.\",\n\t\"license_title\": \"License
